webpackJsonp([32741853805878],{590:function(e,i){e.exports={data:{markdownRemark:{html:'<p>ようやく Nightly(Weekly?) Build 特有のきな臭さが出てきたな……。 Windows 10 Insider Preview の新しいビルド、14915 が来ていたので寝る前にインストール。 朝起きたら無線 LAN がうんともすんとも言わなくなった。 問題が起きた PC は、<a href="/surface-pro">Microsoft Surface Pro</a>。</p>\n<h2>やったこと</h2>\n<ol>\n<li>ドライバを削除して強制再インストール→効果なし</li>\n<li>ツーボタン シャットダウン→効果なし</li>\n</ol>\n<p><strong><a href="http://betanews.com/2016/09/01/insider-preview-build-14915-kills-wifi/">Windows 10 Insider Preview Build 14915 killing Wi-Fi for some users, and there\'s no fix - betanews</a></strong></p>\n<p> やはりアップデートが不具合を誘発している原因の模様。 USB 経由での有線接続は行けるようなので、それで騙し騙し運用しつつ、修正アップデートを待つことになりそう。</p>\n<h2>追記</h2>\n<p>報告遅れたけど、14926 の時点でWi-Fi接続は改善されている模様。 その代わりスタートメニューの表示がおかしくなってしまったが……それはいずれ書こう。</p>',frontmatter:{cover:{childImageSharp:{responsiveSizes:{src:"/danmaq.gatsby/static/2016-windows10-insider-problem-5176fbd7942cd47afee39f8bec19c0f5-66952.jpg",srcSet:"/danmaq.gatsby/static/2016-windows10-insider-problem-5176fbd7942cd47afee39f8bec19c0f5-db268.jpg 200w,\n/danmaq.gatsby/static/2016-windows10-insider-problem-5176fbd7942cd47afee39f8bec19c0f5-fed06.jpg 400w,\n/danmaq.gatsby/static/2016-windows10-insider-problem-5176fbd7942cd47afee39f8bec19c0f5-66952.jpg 401w",sizes:"(max-width: 401px) 100vw, 401px"}}},date:"2016-09-02T09:04:38+09:00",strDate:"2016/9/2",title:"Windows10 build 14915、Wi-Fiが死ぬ不具合"}}},pathContext:{path:"/ja/blog/2016/09/02-windows10-build-14915、wi-fiが死ぬ不具合/",langKey:"ja"}}}});
